import React, { useState, useEffect } from 'react';
import '../styles.css'; // Importa el archivo de estilos CSS global

function GetAllCandidatesComponent() {
  // DefiniciÃ³n de estados utilizando el hook useState
  const [data, setData] = useState([]); // Estado para almacenar datos obtenidos del servidor

  useEffect(() => {
    GetAllCandidates(); 
  }, []);

  // PETICION GET -- MOSTRAR ESTUDIANTES
  function GetAllCandidates() {
    fetch('/getAllCandidates') // Hacer una solicitud HTTP GET a '/getAllNotes'
      .then(response => response.json()) // Convertir la respuesta a JSON
      .then(data => setData(data)); // Establecer los datos obtenidos en el estado 'data'
  }

  // Renderizado del componente
  return (
    <div className="students-container">
      <h1 className="students-title">Lista de candidatos</h1>
      {/* Bucle for */}
      {data.map(item => (
        <div key={item.idalumno} className="student-card">
          <h2>{item.nombre}</h2>
          <ul className="student-info-list">
          <li><strong>ID del Estudiante:</strong> {item.studentId}</li>
          <li><strong>Fecha de AsignaciÃ³n:</strong> {item.assignmentDate}</li>
          <li><strong>Estado de Estudiante Dual:</strong> {item.studentDualStatus}</li>
          <li><strong>Estado de Empresa 1:</strong> {item.company1Status}</li>
          <li><strong>Estado de Empresa 2:</strong> {item.company2Status}</li>
          <li><strong>Estado de Empresa 3:</strong> {item.company3Status}</li>
          <li><strong>Primera Empresa:</strong> {item.firstCompany}</li>
          <li><strong>Segunda Empresa:</strong> {item.secondCompany}</li>
          <li><strong>Tercera Empresa:</strong> {item.thirdCompany}</li>
          <li><strong>Empresa Contratada:</strong> {item.hiredCompany}</li>
          <li><strong>Email de Estudiante Dual:</strong> {item.dualStudentEmail}</li>
          <li><strong>OpiniÃ³n de la Empresa:</strong> {item.companyOpinion}</li>
          <li><strong>Observaciones:</strong> {item.observations}</li>
          <li><strong>Turno:</strong> {item.shift}</li>
          <li><strong>Adjunto Recibido:</strong> {item.receivedAttachment}</li>
          <li><strong>Adjunto Completado:</strong> {item.filledAttachment}</li>
          <li><strong>Estado del Calendario:</strong> {item.calendarStatus}</li>
          <li><strong>Adjunto:</strong> {item.attachment}</li>
          <li><strong>Tipo de RelaciÃ³n:</strong> {item.relationshipType}</li>
          <li><strong>CNO:</strong> {item.cno}</li>
          </ul>
        </div>
      ))}
    </div>
   );
}

export default GetAllCandidatesComponent;
